  [],\n\t\"revision_timestamp\": \"2015-05-07T02:32:58.974444\",\n\t\"name\": \"airs-aqua-level-3-monthly-standard-physical-retrieval-airsamsuhsb-v005\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This product is similar to AIRX3STM. However,
  it contains science retrievals that use the Humidity Sounder for Brazil (HSB). Because
  the HSB instrument lived only from September 2002 through January 2003 when it terminally
  failed, the data set covers these five months only.n                  n                  The
  AIRS Level 3 Monthly Gridded Retrieval Product contains standard retrieval means,
  standard deviations and input counts.  Each file covers a calendar month. The mean
  values are simply the arithmetic means of the daily products, weighted by the number
  of input counts for each day in that grid box.n                  n                  The
  geophysical parameters have been averaged and binned into 1 x 1 grid cells, from
  -180.0 to +180.0 deg longitude and from -90.0 to +90.0 deg latitude. For each grid
  map of 4-byte floating-point mean values there is a corresponding 4-byte floating-point
  map of standard deviation and a 2-byte integer grid map of counts. The counts map
  provides the user with the number of points per bin that were included in the mean
  and can be used to generate custom multi-day maps from the daily gridded products.n
  \                 n            The thermodynamic parameters are: Skin Temperature
  (land and sea surface), Air Temperature at the surface, Profiles of Air Temperature
  and Water Vapor, Tropopause Characteristics, Column Precipitable Water, Cloud Amount/Frequency,
  Cloud Height, Cloud Top Pressure, Cloud Top Temperature, Reflectance, Emissivity,
  Surface Pressure, Cloud Vertical Distribution. nn            The trace gases parameters
  are: Total Amounts and Vertical Profiles of Carbon Monoxide, Methane, and Ozone.nn
  \           The actual names of the variables in the data files should be inferred
  from the Processing File Description document.nn                  (The Shortname
  for this product is AIRH3STM).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
